document.addEventListener('scroll', initReCaptchaOnEvent);
    document.addEventListener('mousemove', initReCaptchaOnEvent);
    document.addEventListener('touchstart', initReCaptchaOnEvent);
    function initReCaptchaOnEvent(event) {
        initReCaptcha();
        event.currentTarget.removeEventListener(event.type, initReCaptchaOnEvent); // remove the event listener that got triggered
    }
    
    function initReCaptcha() {
        if (window.ReCaptchaDidInit) {
        return false;
        }
        window.ReCaptchaDidInit = true; // flag to ensure script does not get added to DOM more than once.
        var head = document.getElementsByTagName('head')[0]
        var script = document.createElement('script')
        script.type = 'text/javascript';
        script.id= 'recaptcha-js';
        script.src = 'https://www.google.com/recaptcha/api.js?render=6LcHnVUcAAAAAE8ptyrXcICXX6IIStuGIdd_zHW4'
        head.appendChild(script);
        console.log('ReCaptchaDidInit');
    }

    function add_referrer_url(){
        var url_container = document.querySelector('#contact-form-url');
        const searchParams = new URLSearchParams(window.location.search);
        if(searchParams.has('referrer_url')){
            let referrer_url = searchParams.get('referrer_url');
            url_container.value = decodeURIComponent(referrer_url);
            console.log("updated url to referrer");
        }
        else{
            console.log("referrer url not found");
        }
    }

    document.addEventListener("DOMContentLoaded", function(){
        add_referrer_url();
    });;
